import js from '@eslint/js'
import globals from 'globals'

export default [
  {
    languageOptions: {
      globals: {
        ...globals.browser,
        ...globals.webextensions,
        ...globals.node,
      }
    }
  },
  js.configs.recommended,
  {
    ignores: [
      '__TEST__',
      '**/dist/',
      '**/e2e-report/',
      '**/webpack.config.js',
      '**/postcss.config.js',
      '**/tailwind.config.js',
      '**/stylelint.config.json'
    ]
  }
]

{
  "name": "extension",
  "description": "Create cross-browser extensions with no build configuration."
}

import {defineConfig, devices} from '@playwright/test'

/**
 * Read environment variables from file.
 * https://github.com/motdotla/dotenv
 */
// import dotenv from 'dotenv';
// dotenv.config({ path: path.resolve(__dirname, '.env') });

/**
 * See https://playwright.dev/docs/test-configuration.
 */
export default defineConfig({
  // timeout to 40s
  timeout: 40 * 1000,
  testDir: './examples',
  /* Run tests in files in parallel */
  fullyParallel: true,
  /* Fail the build on CI if you accidentally left test.only in the source code. */
  forbidOnly: !!process.env.CI,
  /* Retry on CI only */
  retries: process.env.CI ? 2 : 0,
  /* Opt out of parallel tests on CI. */
  workers: process.env.CI ? 1 : undefined,
  /* Reporter to use. See https://playwright.dev/docs/test-reporters */
  reporter: [['html', {outputFolder: 'e2e-report'}]],
  /* Shared settings for all the projects below. See https://playwright.dev/docs/api/class-testoptions. */
  use: {
    /* Base URL to use in actions like `await page.goto('/')`. */
    // baseURL: 'http://127.0.0.1:3000',

    /* Collect trace when retrying the failed test. See https://playwright.dev/docs/trace-viewer */
    trace: 'retain-on-failure'
  },

  /* Configure projects for major browsers */
  projects: [
    {
      name: 'chromium',
      use: {...devices['Desktop Chrome']}
    }

    // {
    //   name: 'firefox',
    //   use: { ...devices['Desktop Firefox'] },
    // },

    // {
    //   name: 'webkit',
    //   use: { ...devices['Desktop Safari'] },
    // },

    /* Test against mobile viewports. */
    // {
    //   name: 'Mobile Chrome',
    //   use: { ...devices['Pixel 5'] },
    // },
    // {
    //   name: 'Mobile Safari',
    //   use: { ...devices['iPhone 12'] },
    // },

    /* Test against branded browsers. */
    // {
    //   name: 'Microsoft Edge',
    //   use: { ...devices['Desktop Edge'], channel: 'msedge' },
    // },
    // {
    //   name: 'Google Chrome',
    //   use: { ...devices['Desktop Chrome'], channel: 'chrome' },
    // },
  ]

  /* Run your local dev server before starting the tests */
  // webServer: {
  //   command: 'npm run start',
  //   url: 'http://127.0.0.1:3000',
  //   reuseExistingServer: !process.env.CI,
  // },
})

const path = require('path')
const fs = require('fs')

const [, pathOrRemoteUrl] = process.argv.slice(2)
const projectDir = pathOrRemoteUrl.startsWith('http')
  ? process.cwd() + path.basename(pathOrRemoteUrl)
  : path.resolve(__dirname, pathOrRemoteUrl)

const tailwindConfig = path.join(projectDir, 'tailwind.config.js')

/** @type {import('tailwindcss').Config} */
const tailwindConfigData = fs.existsSync(tailwindConfig)
  ? require(tailwindConfig)
  : {content: []}

/** @type {import('tailwindcss').Config} */
const tailwindRootConfig = {
  ...tailwindConfigData,
  content: [
    // eslint-disable-next-line @typescript-eslint/no-unsafe-argument
    ...tailwindConfigData.content.map((file) => path.join(projectDir, file))
  ]
}

module.exports = tailwindRootConfig
